import {} from 'react-beautiful-dnd'
import logo from './logo.svg';
import './App.css';



const data = [
  {
    id:'item-1',
    content:'Item-1'
  },
  {
    id:'item-2',
    content:'Item-2'
  },
  {
    id:'item-3',
    content:'Item-3'
  },
  {
    id:'item-4',
