  },
  {
    id:'item-7',
    content:'Item-7'
  },
  {
    id:'item-8',
    content:'Item-8'
  },
  {
    id:'item-9',
    content:'Item-9'
  },
]



const App = ()=> {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
